PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "sessions" (
  "id" integer PRIMARY KEY,
  "created" datetime,
  "finished" datetime,
  "loadpoint" text,
  "identifier" text,
  "vehicle" text,
  "meter_start_kwh" real,
  "meter_end_kwh" real,
  "charged_kwh" real,
  "odometer" real
, `solar_percentage` real, `price` real, `price_per_kwh` real, `co2_per_kwh` real);


COMMIT;
